defs.value:
pub enum Value {
    Unit,
    Bool {
            value: bool,
        },
    I8 {
            value: i8,
        },
    I16 {
            value: i16,
        },
    I32 {
            value: i32,
        },
    I64 {
            value: i64,
        },
    I128 {
            value: i128,
        },
    U8 {
            value: u8,
        },
    U16 {
            value: u16,
        },
    U32 {
            value: u32,
        },
    U64 {
            value: u64,
        },
    U128 {
            value: u128,
        },
    String {
            value: String,
        },
    Struct {
            fields: Vec<Value>,
        },
    Enum {
            name: String,
            fields: Vec<Value>,
        },
    Option {
            value: Box<Option<Value>>,
        },
    Array {
            element_type_id: u8,
            elements: Vec<Value>,
        },
    Tuple {
            elements: Vec<Value>,
        },
    Result {
            value: Box<Result<Value, Value>>,
        },
    Vec {
            element_type_id: u8,
            elements: Vec<Value>,
        },
    TreeSet {
            element_type_id: u8,
            elements: Vec<Value>,
        },
    TreeMap {
            key_type_id: u8,
            value_type_id: u8,
            elements: Vec<Value>,
        },
    HashSet {
            element_type_id: u8,
            elements: Vec<Value>,
        },
    HashMap {
            key_type_id: u8,
            value_type_id: u8,
            elements: Vec<Value>,
        },
    Custom {
            type_id: u8,
            bytes: Vec<u8>,
        },
}

pub enum DecodeError {
    Underflow {
            required: usize,
            remaining: usize,
        },
    InvalidType {
            expected: Option<u8>,
            actual: u8,
        },
    InvalidName {
            expected: String,
            actual: String,
        },
    InvalidLength {
            expected: usize,
            actual: usize,
        },
    InvalidIndex(u8),
    InvalidEnum(String),
    InvalidBool(u8),
    InvalidUtf8,
    NotAllBytesUsed(usize),
    InvalidCustomData(u8),
    DuplicateEntry,
}

pub enum Type {
    Unit,
    Bool,
    I8,
    I16,
    I32,
    I64,
    I128,
    U8,
    U16,
    U32,
    U64,
    U128,
    String,
    Option {
            value: Box<Type>,
        },
    Array {
            element: Box<Type>,
            length: u16,
        },
    Tuple {
            elements: Vec<Type>,
        },
    Struct {
            name: String,
            fields: Fields,
        },
    Enum {
            name: String,
            variants: Vec<Variant>,
        },
    Result {
            okay: Box<Type>,
            error: Box<Type>,
        },
    Vec {
            element: Box<Type>,
        },
    TreeSet {
            element: Box<Type>,
        },
    TreeMap {
            key: Box<Type>,
            value: Box<Type>,
        },
    HashSet {
            element: Box<Type>,
        },
    HashMap {
            key: Box<Type>,
            value: Box<Type>,
        },
    Custom {
            name: String,
            generics: Vec<Type>,
        },
}

pub enum Fields {
    Named {
            named: Vec<(String, Type)>,
        },
    Unnamed {
            unnamed: Vec<Type>,
        },
    Unit,
}
